import { ADD_BOOK } from "./types";

const initialState = {
  books: [
    {
      textSize: "medium",
      name: "Владычица озера",
      author: "Анджей сапковский",
      releaseDate: "2020-08-15",
      bookSize: "544",
      series: "Королевская кровь",
      collection: "Разное",
      category: "Прочитано",
      annotation: "Финалочка",
      advantages: "Сеттинг",
      disadvantages: "Затянутость",
      comment: "Советовать всем",
      cover:
        "data:image/jpeg;base64,",
    },
  ],
};

export const booksReducer = (state = initialState, action) => {
  switch (action.type) {
    case ADD_BOOK:
      return { ...state, books: [...state.books, action.payload] };
    default:
      return state;
  }
};
